def calculate_king_journey(n, m):
    ans = ['1 1']
    warp = [-1] / 4
    if n == 1 and m == 2:
        ans.append('1 2')
    elif n == 2 and m == 1:
        ans.append('2 1')
    elif n == 1:
        warp = [1, m, 1, 1]
        for i in range(2, m + 1):
            ans.append(f'1 {i}')
    elif m == 1:
        warp = [n, 1, 1, 1]
        for i in range(2, n + 1):
            ans.append(f'{i} 1')
    elif n % 2 == 0:
        for i in range(2, n + 1):
            itr = range(1, m) if i % 2 == 0 else range(m - 1, 0, -1)
            for j in itr:
                ans.append(f'{i} {j}')
        for i in range(n, 1, -1):
            ans.append(f'{i} {m}')
        for j in range(m, 1, -1):
            ans.append(f'1 {j}')
    elif m % 2 == 0:
        for j in range(2, m + 1):
            itr = range(1, n) if j % 2 == 0 else range(n - 1, 0, -1)
            for i in itr:
                ans.append(f'{i} {j}')
        for j in range(m, 1, -1):
            ans.append(f'{n} {j}')
        for i in range(n, 1, -1):
            ans.append(f'{i} 1')
    else:
        ans.pop()
        warp = [n, m, 1, 1]
        for i in range(1, n + 1):
            itr = range(1, m + 1) if i % 2 else range(m, 0, -1)
            for j in itr:
                ans.append(f'{i} {j}')
    ans.append('1 1')
    teleporters = []
    if warp[0] != -1:
        teleporters.append(tuple(warp))
    path = [tuple(map(int, coord.split())) for coord in ans]
    return (teleporters, path)

